import React from 'react';
import styled from 'styled-components';
import { Translate } from 'react-redux-i18n';
import { Link } from 'react-router-dom';
import {
  Paragraph,
  Headline,
  SubHeadline1,
} from '../shared/typography/Typography';

const Content = styled.div`
  padding: 2rem 5vw;
  grid-area: content;
`;

const PageNotFound = () => (
  <Content>
    <Headline top uppercase>
      <Translate value="common.app" />
    </Headline>
    <SubHeadline1>
      <Translate value="pageNotFound.title" />
    </SubHeadline1>
    <Paragraph>
      <Link to="/">
        <Translate value="pageNotFound.backToHomepage" />
      </Link>
    </Paragraph>
  </Content>
);

export default PageNotFound;
